CREATE TABLE "IGBT"
(
    "ID" SERIAL PRIMARY KEY,
    "Product (WPN)"	VARCHAR(512),
    "Datasheet"	VARCHAR(512),
    "OPN"	VARCHAR(512),
    "Price"	FLOAT,
    "Description"	VARCHAR(512),
    "V(BR)CES Typ (V)"	INT,
    "IC Max (A)"	FLOAT,
    "VCE(sat) Typ (V)"	FLOAT,
    "PD Max (W)"	FLOAT,
    "Co-Packaged Diode"	BOOLEAN,
    "Short Circuit Withstand (µs)"	INT,
    "Package Type"	VARCHAR(512),
    "VF Typ (V)"	FLOAT,
    "Eon Typ (mJ)"	FLOAT,
    "Eoff Typ (mJ)"	FLOAT,
    "Trr Typ (ns)"	FLOAT,
    "Irr Typ (A)"	VARCHAR(512),
    "QG Typ (nC)"	FLOAT,
    "EAS Typ (mJ)"	INT,
    "Qualification"	VARCHAR(512),
    "AEC Qualified"	BOOLEAN,
    "PPAP Capable"	BOOLEAN,
    "Halide Free"	BOOLEAN,
    "Lead Free"	BOOLEAN,
    "Status"	VARCHAR(512)
);

